import React, { useState } from 'react';
import './Registration.css';

const Registration = () => {
  const [formData, setFormData] = useState({
    companyName: '',
    addressLine1: '',
    addressLine2: '',
    areaCity: '',
    state: '',
    pinCode: '',
    tel: '',
    fax: '',
    holdingType: '',
    authorizedPersonName: '',
    designation: '',
    authorizedTel: '',
    authorizedCell: '',
    stNo: '',
    vatRegNo: '',
    panNo: '',
    email: '',
    password: '',
  });

  const [error, setError] = useState('');

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    // Ensure required fields are filled in
    const requiredFields = [
      'companyName', 'addressLine1', 'areaCity', 'state', 'pinCode',
      'holdingType', 'authorizedPersonName', 'designation', 'email', 'password'
    ];
    for (const field of requiredFields) {
      if (!formData[field]) {
        setError('Please fill in all required fields.');
        return;
      }
    }

    // Prepare form data to be submitted
    const dataToSubmit = { ...formData };

    try {
      const response = await fetch('your_backend_endpoint_here', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(dataToSubmit),
      });

      if (!response.ok) {
        throw new Error('Failed to submit registration.');
      }

      const responseData = await response.json();
      console.log('Form submitted successfully:', responseData);
      alert('Registration submitted successfully!');
      setFormData({
        companyName: '',
        addressLine1: '',
        addressLine2: '',
        areaCity: '',
        state: '',
        pinCode: '',
        tel: '',
        fax: '',
        holdingType: '',
        authorizedPersonName: '',
        designation: '',
        authorizedTel: '',
        authorizedCell: '',
        stNo: '',
        vatRegNo: '',
        panNo: '',
        email: '',
        password: ''
      });
    } catch (error) {
      console.error('Error submitting registration:', error);
      setError('An error occurred. Please try again later.');
    }
  };

  const handleClear = () => {
    setFormData({
      companyName: '',
      addressLine1: '',
      addressLine2: '',
      areaCity: '',
      state: '',
      pinCode: '',
      tel: '',
      fax: '',
      holdingType: '',
      authorizedPersonName: '',
      designation: '',
      authorizedTel: '',
      authorizedCell: '',
      stNo: '',
      vatRegNo: '',
      panNo: '',
      email: '',
      password: ''
    });
    setError('');
  };

  return (
    <div className="registration-container">
      <h2>Company Registration</h2>
      {error && <p className="error-message">{error}</p>}
      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label htmlFor="companyName">Company Name*:</label>
          <input
            type="text"
            id="companyName"
            name="companyName"
            value={formData.companyName}
            onChange={handleChange}
            required
          />
        </div>

        <div className="form-group">
          <label htmlFor="addressLine1">Address Line 1*:</label>
          <input
            type="text"
            id="addressLine1"
            name="addressLine1"
            value={formData.addressLine1}
            onChange={handleChange}
            required
          />
        </div>

        <div className="form-group">
          <label htmlFor="addressLine2">Address Line 2:</label>
          <input
            type="text"
            id="addressLine2"
            name="addressLine2"
            value={formData.addressLine2}
            onChange={handleChange}
          />
        </div>

        <div className="form-group">
          <label htmlFor="areaCity">Area / City*:</label>
          <input
            type="text"
            id="areaCity"
            name="areaCity"
            value={formData.areaCity}
            onChange={handleChange}
            required
          />
        </div>

        <div className="form-group">
          <label htmlFor="state">State*:</label>
          <input
            type="text"
            id="state"
            name="state"
            value={formData.state}
            onChange={handleChange}
            required
          />
        </div>

        <div className="form-group">
          <label htmlFor="pinCode">Pin Code*:</label>
          <input
            type="text"
            id="pinCode"
            name="pinCode"
            value={formData.pinCode}
            onChange={handleChange}
            required
          />
        </div>

        <div className="form-group">
          <label htmlFor="tel">Tel:</label>
          <input
            type="text"
            id="tel"
            name="tel"
            value={formData.tel}
            onChange={handleChange}
          />
        </div>

        <div className="form-group">
          <label htmlFor="fax">Fax:</label>
          <input
            type="text"
            id="fax"
            name="fax"
            value={formData.fax}
            onChange={handleChange}
          />
        </div>

        <div className="form-group">
          <label htmlFor="holdingType">Holding Type*:</label>
          <select
            id="holdingType"
            name="holdingType"
            value={formData.holdingType}
            onChange={handleChange}
            required
          >
            <option value="">Select Holding Type</option>
            <option value="Proprietary">Proprietary</option>
            <option value="Pvt. Ltd">Pvt. Ltd</option>
            <option value="Ltd">Ltd</option>
          </select>
        </div>

        <div className="form-group">
          <label htmlFor="authorizedPersonName">Authorized Person Name*:</label>
          <input
            type="text"
            id="authorizedPersonName"
            name="authorizedPersonName"
            value={formData.authorizedPersonName}
            onChange={handleChange}
            required
          />
        </div>

        <div className="form-group">
          <label htmlFor="designation">Designation*:</label>
          <input
            type="text"
            id="designation"
            name="designation"
            value={formData.designation}
            onChange={handleChange}
            required
          />
        </div>

        <div className="form-group">
          <label htmlFor="authorizedTel">Authorized Tel:</label>
          <input
            type="text"
            id="authorizedTel"
            name="authorizedTel"
            value={formData.authorizedTel}
            onChange={handleChange}
          />
        </div>

        <div className="form-group">
          <label htmlFor="authorizedCell">Authorized Cell:</label>
          <input
            type="text"
            id="authorizedCell"
            name="authorizedCell"
            value={formData.authorizedCell}
            onChange={handleChange}
          />
        </div>

        <div className="form-group">
          <label htmlFor="stNo">ST No:</label>
          <input
            type="text"
            id="stNo"
            name="stNo"
            value={formData.stNo}
            onChange={handleChange}
          />
        </div>

        <div className="form-group">
          <label htmlFor="vatRegNo">VAT Reg. No:</label>
          <input
            type="text"
            id="vatRegNo"
            name="vatRegNo"
            value={formData.vatRegNo}
            onChange={handleChange}
          />
        </div>

        <div className="form-group">
          <label htmlFor="panNo">PAN No:</label>
          <input
            type="text"
            id="panNo"
            name="panNo"
            value={formData.panNo}
            onChange={handleChange}
          />
        </div>

        {/* New email and password fields */}
        <div className="form-group">
          <label htmlFor="email">Email*:</label>
          <input
            type="email"
            id="email"
            name="email"
            value={formData.email}
            onChange={handleChange}
            required
          />
        </div>

        <div className="form-group">
          <label htmlFor="password">Password*:</label>
          <input
            type="password"
            id="password"
            name="password"
            value={formData.password}
            onChange={handleChange}
            required
          />
        </div>

        <div className="form-buttons">
          <button type="submit">Submit</button>
          <button type="button" onClick={handleClear}>Clear</button>
        </div>
      </form>
    </div>
  );
};

export default Registration;
